import React from 'react';
import { useParams, Link } from 'react-router-dom';
import { useTranslation } from '../hooks/useTranslation';
import { useLanguage } from '../hooks/useLanguage';
import { ZODIAC_SIGNS } from '../utils/constants';
import { generateHoroscope } from '../services/horoscopeService';
import StarRating from '../components/ui/StarRating';

const HoroscopeDetailPage = () => {
  const { sign, lang } = useParams();
  const { t } = useTranslation();
  const { currentLanguage } = useLanguage();
  
  const zodiacInfo = ZODIAC_SIGNS[sign];
  const horoscope = generateHoroscope(sign);
  
  if (!zodiacInfo) {
    return (
      <div className="container mx-auto px-4 py-8 text-center">
        <h1 className="text-2xl font-bold text-red-600">{t('errors.signNotFound')}</h1>
        <Link to={`/${currentLanguage}`} className="text-purple-600 hover:underline mt-4 inline-block">
          {t('navigation.backToHome')}
        </Link>
      </div>
    );
  }

  return (
    <div className="container mx-auto px-4 py-8">
      <div className="max-w-4xl mx-auto">
        {/* 返回按钮 */}
        <Link 
          to={`/${currentLanguage}`} 
          className="inline-flex items-center text-purple-600 hover:text-purple-800 mb-6"
        >
          ← {t('navigation.backToHome')}
        </Link>

        {/* 星座标题 */}
        <div className="text-center mb-8">
          <div className="text-6xl mb-4">{zodiacInfo.symbol}</div>
          <h1 className="text-4xl font-bold text-gray-800 mb-2">
            {t(`zodiac.${sign}.name`)}
          </h1>
          <p className="text-gray-600 text-lg">
            {zodiacInfo.dates} • {t(`elements.${zodiacInfo.element.toLowerCase()}`)}
          </p>
        </div>

        {/* 今日运势 */}
        <div className="bg-white rounded-lg shadow-lg p-6 mb-6">
          <h2 className="text-2xl font-bold text-gray-800 mb-4">
            {t('horoscope.todaysFortune')}
          </h2>
          
          <div className="grid md:grid-cols-2 gap-6">
            <div>
              <h3 className="font-semibold text-gray-700 mb-2">{t('horoscope.overall')}</h3>
              <StarRating rating={horoscope.overall} />
              <p className="text-gray-600 mt-2">{horoscope.description}</p>
            </div>
            
            <div className="space-y-4">
              <div>
                <h4 className="font-medium text-gray-700">{t('horoscope.love')}</h4>
                <StarRating rating={horoscope.love} />
              </div>
              <div>
                <h4 className="font-medium text-gray-700">{t('horoscope.career')}</h4>
                <StarRating rating={horoscope.career} />
              </div>
              <div>
                <h4 className="font-medium text-gray-700">{t('horoscope.money')}</h4>
                <StarRating rating={horoscope.money} />
              </div>
              <div>
                <h4 className="font-medium text-gray-700">{t('horoscope.health')}</h4>
                <StarRating rating={horoscope.health} />
              </div>
            </div>
          </div>
        </div>

        {/* 幸运元素 */}
        <div className="bg-gradient-to-r from-purple-50 to-pink-50 rounded-lg p-6">
          <h3 className="text-xl font-bold text-gray-800 mb-4">{t('horoscope.luckyElements')}</h3>
          <div className="grid md:grid-cols-3 gap-4">
            <div>
              <span className="font-medium text-gray-700">{t('horoscope.luckyNumber')}: </span>
              <span className="text-purple-600 font-bold">{horoscope.luckyNumber}</span>
            </div>
            <div>
              <span className="font-medium text-gray-700">{t('horoscope.luckyColor')}: </span>
              <span className="text-purple-600 font-bold">{horoscope.luckyColor}</span>
            </div>
            <div>
              <span className="font-medium text-gray-700">{t('horoscope.compatibility')}: </span>
              <span className="text-purple-600 font-bold">{t(`zodiac.${horoscope.compatibility}.name`)}</span>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default HoroscopeDetailPage;
